INSERT INTO `movie` VALUES (2320,'tt0116253','Executive Decision',1996,55000000,121969216,5.8,'R',133,'Terrorists hijack a 747 inbound to Washington D.C., demanding the the release of their imprisoned leader. Intelligence expert David Grant (Kurt Russell) suspects another reason and he is soon the reluctant member of a special assault team that is assigned to intercept the plane and hijackers.','The man. The myth. The Legend. Steven Seagal in...Executive Decision','//image.tmdb.org/t/p/w300_and_h450_bestv2/wmgkFuEr8bHRAgs1HS5U46Rzo0I.jpg');
INSERT INTO `movie` VALUES (3512,'tt0114781','Under Siege 2: Dark Territory',1995,60000000,104324083,5.6,'R',100,'A passenger train has been hijacked by an electronics expert and turned into an untraceable command center for a weapons satellite. He has planned to blow up Washington DC and only one man can stop him, former Navy SEAL Casey Ryback.','The man. The myth. The Legend. Steven Seagal in...Under Siege 2: Dark Territory','//image.tmdb.org/t/p/w300_and_h450_bestv2/6Z1p71nkm45cYuIZWOx5JSCYc0o.jpg');
INSERT INTO `movie` VALUES (6058,'tt0120786','The Patriot',1998,25000000,0,4.0,'NR',90,'A deadly virus threatens to wipe out an entire Rocky Mountain town, leaving the town doctor to find some way to escape the soldiers who enforce the town''s quarantine and devise an antidote. Matters take a more deadly turn after the physician is captured by a dangerously unstable band of militia extremists.','The man. The myth. The Legend. Steven Seagal in...The Patriot','//image.tmdb.org/t/p/w300_and_h450_bestv2/thMkesyVxyVzREKwndv9MnNtc05.jpg');
INSERT INTO `movie` VALUES (8382,'tt0431114','Today You Die',2005,0,0,4.1,'R',92,'A former thief who is trying to go straight seeks vengeance on those who framed him.','The man. The myth. The Legend. Steven Seagal in...Today You Die','//image.tmdb.org/t/p/w300_and_h450_bestv2/fSL56vXRp4Qh23vXPiAhJMFKZgB.jpg');
INSERT INTO `movie` VALUES (8845,'tt0105690','Under Siege',1992,35000000,156563139,6.1,'R',103,'This action-packed thriller takes place on the soon-to-be-decommissioned USS Missouri. Disgruntled ex-CIA operative Strannix, his assistant Krill and their group of terrorists seize the battleship with nuclear blackmail in mind. They''ve planned for every contingency but ignore the ship''s cook, former Navy SEAL Casey Ryback -- an error that could be fatal.','The man. The myth. The Legend. Steven Seagal in...Under Siege','//image.tmdb.org/t/p/w300_and_h450_bestv2/duxM3HJ55Fpc4A3krziKn1FR22K.jpg');
INSERT INTO `movie` VALUES (9395,'tt0094602','Above the Law',1988,7500000,18869631,5.9,'R',99,'Seagal is Nico Toscani, an Italian immigrant, American patriot, ex-CIA agent, aikido specialist, and unorthodox Chicago policeman. He is as committed to his job as he is to his personalized brand of justice: expert and thorough bone-crushing.','The man. The myth. The Legend. Steven Seagal in...Above the Law','//image.tmdb.org/t/p/w300_and_h450_bestv2/20bD11jTM2fbVGkDnkCpfriUW4y.jpg');
INSERT INTO `movie` VALUES (9569,'tt0099739','Hard to Kill',1990,10000000,47410000,5.6,'R',96,'Mason Storm, a ''go it alone'' cop, is gunned down at home. The intruders kill his wife, and think they''ve killed both Mason and his son too. Mason is secretly taken to a hospital where he spends several years in a coma. His son meanwhile is growing up thinking his father is dead. When Mason wakes up, everyone is in danger - himself, his son, his best friend, his nurse - but most of all those who arranged for his death','The man. The myth. The Legend. Steven Seagal in...Hard to Kill','//image.tmdb.org/t/p/w300_and_h450_bestv2/ucgu8ZE7LN4HerIXqKvCS73Mga5.jpg');
INSERT INTO `movie` VALUES (9624,'tt0110725','On Deadly Ground',1994,50000000,49000000,4.5,'R',102,'Forrest Taft is an environmental agent who works for the Aegis Oil Company in Alaska. Aegis Oil''s corrupt CEO, Michael Jennings, is the kind of person who doesn''t care whether or not oil spills into the ocean or onto the land, just as long as it''s making money for him.','The man. The myth. The Legend. Steven Seagal in...On Deadly Ground','//image.tmdb.org/t/p/w300_and_h450_bestv2/o4MHLiInd97SSdFR9hhoqwDAqQn.jpg');
INSERT INTO `movie` VALUES (9625,'tt0116421','The Glimmer Man',1996,45000000,0,4.7,'R',92,'A former government operative renowned for his stealth, Jack Cole is now a Los Angeles police detective. When a series of horrible murders occurs in the metro area, Cole is assigned to the case, along with tough-talking fellow cop Jim Campbell. Although the two men clash, they gradually become effective partners as they uncover a conspiracy linked to the killings, which also involves terrorism and organized crime.','The man. The myth. The Legend. Steven Seagal in...The Glimmer Man','//image.tmdb.org/t/p/w300_and_h450_bestv2/2I1BMhKrjK9wcxvJ2SllttPIsIh.jpg');
INSERT INTO `movie` VALUES (9914,'tt0448114','Shadow Man',2006,0,0,4.4,'R',91,'An intelligence operative discovers that no one is what they seem in the shadowy world of espionage.','The man. The myth. The Legend. Steven Seagal in...Shadow Man','//image.tmdb.org/t/p/w300_and_h450_bestv2/fYXKSKnNxAN0fS4hq1sHY9cdZvK.jpg');
INSERT INTO `movie` VALUES (10049,'tt0493424','Attack Force',2006,0,0,4.5,'R',94,'Marshall Lawson is the commander of an elite military unit. Marshall Lawson loses his strike-team in a cold-blooded and seemingly random attack, and he takes it upon himself to investigate the attack, with the help of his girlfriend Tia and his friend Dwayne.','The man. The myth. The Legend. Steven Seagal in...Attack Force','//image.tmdb.org/t/p/w300_and_h450_bestv2/tVRnjtea9diIsscFXeqEjPDWVoR.jpg');
INSERT INTO `movie` VALUES (10167,'tt0297162','Half Past Dead',2002,13000000,0,4.6,'PG-13',98,'This movie tells the story of a man who goes undercover in a hi-tech prison to find out information to help prosecute those who killed his wife. While there he stumbles onto a plot involving a death-row inmate and his $200 million stash of gold.','The man. The myth. The Legend. Steven Seagal in...Half Past Dead','//image.tmdb.org/t/p/w300_and_h450_bestv2/hO6GAvvXhhgLoe7a9BUhc563Sun.jpg');
INSERT INTO `movie` VALUES (10173,'tt0100114','Marked for Death',1990,12000000,46044400,5.6,'R',94,'Just retired from the Drug Enforcement Agency, John Hatcher (Seagal) returns to his hometown and quickly discovers that drugs have infiltrated his old neighborhood. Determined to drive the dealers out , Hatcher crosses pathes with a ferocious Jamaican druglord who vowes that Hatcher and his family are now marked for death.','The man. The myth. The Legend. Steven Seagal in...Marked for Death','//image.tmdb.org/t/p/w300_and_h450_bestv2/m1j9lmBRdQfCsgvFQFbwSr7uFiD.jpg');
INSERT INTO `movie` VALUES (10877,'tt0242445','Exit Wounds',2001,50000000,79958599,5.3,'R',101,'Maverick cop Orin Boyd always brings down the domestic terrorists he tracks, but he ruffles feathers with his unorthodox techniques -- and soon finds himself reassigned to the toughest district in Detroit. When he discovers a group of detectives secretly operating a drug ring, Boyd joins forces with an unlikely ally -- gangster Latrell Walker -- to bring down the rotten cops.','The man. The myth. The Legend. Steven Seagal in...Exit Wounds','//image.tmdb.org/t/p/w300_and_h450_bestv2/ioPpykV342e0zIuqbJxdOwcMZMS.jpg');
INSERT INTO `movie` VALUES (12542,'tt0357474','Belly of the Beast',2003,14000000,0,4.8,'R',91,'Jake and Sunti go to meet Mongkol, the leader of the Abu Karaf. Mongkol confirms that ever since the terrorist attacks of September 11, 2001, Jantapan has worked to corner the narcotics and arms markets. Jake must engage in a battle that will put both his physical and spiritual powers to the ultimate test.','The man. The myth. The Legend. Steven Seagal in...Belly of the Beast','//image.tmdb.org/t/p/w300_and_h450_bestv2/yAtMx6s3o1t6A1FopMyqG3J9PY8.jpg');
INSERT INTO `movie` VALUES (13722,'tt0427528','Mercenary for Justice',2006,15000000,0,4.3,'R',91,'Mercenary John Seeger is one of the best in the business. John and his crew battle some soldiers on Galmoral Island in Southern Africa as they''re trying to rescue the French Ambassador -- there''s a coup going on. Some of John''s soldiers unload their machine guns into the Ambassador and his family, blowing the mission and getting his best friend Radio Jones killed. He heads back to the US and visits Radio''s wife Shondra to tells her the news, and then promises that he''ll take care of her and her son Eddie. But shortly after he makes that vow, Shondra and Eddie get kidnapped.','The man. The myth. The Legend. Steven Seagal in...Mercenary for Justice','//image.tmdb.org/t/p/w300_and_h450_bestv2/7oV5BkxFv7jpLiwu8q2YEMr8uVa.jpg');
INSERT INTO `movie` VALUES (14180,'tt0416243','Submerged',2005,15000000,0,4.0,'NR',96,'Chris Kody, imprisoned member of the US military, is released from prison and reunited with his old team in order to pursue a renegade scientist. The catch, the scientist has developed mind control technology that can make even your friends into heartless killers.','The man. The myth. The Legend. Steven Seagal in...Submerged','//image.tmdb.org/t/p/w300_and_h450_bestv2/aBjU10jE0256pbQMbSHAinnpm8n.jpg');
INSERT INTO `movie` VALUES (14289,'tt0119123','Fire Down Below',1997,60000000,16000000,5.0,'R',105,'Martial arts star Steven Seagal stars in this action drama as Jack Taggart, an undercover agent working for the Environmental Protection Agency. When an EPA representative is murdered in a small Appalachian community, Taggart is sent in -- posing as a handyman working with a Christian relief agency -- to find out what happened.','The man. The myth. The Legend. Steven Seagal in...Fire Down Below','//image.tmdb.org/t/p/w300_and_h450_bestv2/nflONy2WMEui7uCGCAtkD1r9vnl.jpg');
INSERT INTO `movie` VALUES (14362,'tt0102614','Out for Justice',1991,14000000,39673161,5.9,'R',91,'Gino Felino (Steven Seagal) is an NYPD detective from Brooklyn who knows everyone and everything in his neighborhood. Killing his Partner was someone''s mistake, because he''s now Out For Justice.','The man. The myth. The Legend. Steven Seagal in...Out for Justice','//image.tmdb.org/t/p/w300_and_h450_bestv2/p9ytbkDGGgni5E0QdWb1ttxwXCc.jpg');
INSERT INTO `movie` VALUES (14452,'tt1107859','Kill Switch',2008,10000000,0,4.4,'R',96,'A troubled detective travels to Memphis in order to track down a pair of serial killers.','The man. The myth. The Legend. Steven Seagal in...Kill Switch','//image.tmdb.org/t/p/w300_and_h450_bestv2/f92hqOzLzzlnqxVNv4nAxXxZhbV.jpg');
INSERT INTO `movie` VALUES (14771,'tt0392878','The Onion Movie',2008,0,0,6.0,'NC-17',80,'Venerable newscaster Norm Archer reports the latest news in politics, health, culture and entertainment - such as an automotive recall of decapitation-inducing "Neckbelts" and a study finding that "depression hits losers hardest". This compilation of bogus news stories, celebrity profiles, movie trailers and skits come courtesy of the ace satirists at The Onion.','The man. The myth. The Legend. Steven Seagal in...The Onion Movie','//image.tmdb.org/t/p/w300_and_h450_bestv2/5VIKdXMoyrTcCq4fe4ZUpeeJ1o.jpg');
INSERT INTO `movie` VALUES (15039,'tt1194271','Against the Dark',2009,9000000,0,3.6,'R',94,'When most of the population of Earth is infected by a virus and transformed into flesh eaters and blood drinking creatures, a group of hunters lead by Tao and his sword chase the vampire zombies to eliminate them. Six non-infected survivors try to find the exit of an abandoned hospital crowded of the infected creatures. Meanwhile, the military is ready to bomb the whole area.','The man. The myth. The Legend. Steven Seagal in...Against the Dark','//image.tmdb.org/t/p/w300_and_h450_bestv2/8KteXSDzXHTZLlvTstiQ2tEGWVY.jpg');
INSERT INTO `movie` VALUES (17314,'tt1014801','Pistol Whipped',2008,10000000,0,5.5,'R',96,'Steven Seagal stars in this gritty, no-holds barred action film as an elite ex-cop with a gambling problem and a mountain of debt. When a mysterious man offers to clear his debts in exchange for the assassination of the city''s most notorious gangsters, he make s decision that will change his life - forever.','The man. The myth. The Legend. Steven Seagal in...Pistol Whipped','//image.tmdb.org/t/p/w300_and_h450_bestv2/9v4a2G7hxjSkuxk2biGPJ4pA1dG.jpg');
INSERT INTO `movie` VALUES (17317,'tt0910934','Urban Justice',2007,12000000,0,5.5,'R',96,'Seagal plays a man with a dark and violent past, who seeks revenge for the murder of his son.','The man. The myth. The Legend. Steven Seagal in...Urban Justice','//image.tmdb.org/t/p/w300_and_h450_bestv2/owBmON7qbru3VvV6AaorgtXhMmF.jpg');
INSERT INTO `movie` VALUES (18070,'tt0443450','Black Dawn',2005,16000000,0,3.6,'R',96,'Jonathan Cold returns, this time he goes Undercover to stop a group of Terrorists before they bomb Los Angeles.','The man. The myth. The Legend. Steven Seagal in...Black Dawn','//image.tmdb.org/t/p/w300_and_h450_bestv2/mXGIa08Gv71ESrVTYNKvH9p8zKS.jpg');
INSERT INTO `movie` VALUES (18248,'tt0312700','The Foreigner',2003,16700000,0,3.7,'R',96,'This story is about a freelance agent (Seagal) who is the courier of a package from France to Germany. He soon finds that many people want to get their hands on it.','The man. The myth. The Legend. Steven Seagal in...The Foreigner','//image.tmdb.org/t/p/w300_and_h450_bestv2/2ZMMwbXGLAiJBcemMTYVqiKWfdK.jpg');
INSERT INTO `movie` VALUES (18472,'tt1227177','Driven To Kill',2009,10000000,0,4.8,'R',98,'A former Russian mobster named Ruslan, who is now a crime novelist, returns home and discovers his daughter is marrying his arch nemesis. His past also comes back to haunt him when his family is threatened. Hungry for justice, Ruslan returns to the life he once knew...with a vengeance.','The man. The myth. The Legend. Steven Seagal in...Driven To Kill','//image.tmdb.org/t/p/w300_and_h450_bestv2/wfJyaY7IRWNWgTQByXzFypqCuL4.jpg');
INSERT INTO `movie` VALUES (18816,'tt0446313','Dragon Squad',2005,0,0,5.3,'NR',110,'A team of Interpol agents arrive in the city to testify against a local crime lord. However on the way to court the vehicle carrying the Triad boss is attacked and the crime lord snatched, not by his own people but by another foe.','The man. The myth. The Legend. Steven Seagal in...Dragon Squad','//image.tmdb.org/t/p/w300_and_h450_bestv2/kVouPYGfcmbd1a3gWOQas7i2DY.jpg');
INSERT INTO `movie` VALUES (23631,'tt0985694','Machete',2010,20000000,31327899,6.3,'R',105,'After being set-up and betrayed by the man who hired him to assassinate a Texas Senator, an ex-Federale launches a brutal rampage of revenge against his former boss.','The man. The myth. The Legend. Steven Seagal in...Machete','//image.tmdb.org/t/p/w300_and_h450_bestv2/3RCX4EzTrpO6wNz536EQPhYM2Fk.jpg');
INSERT INTO `movie` VALUES (24351,'tt0783518','Flight of Fury',2007,12000000,0,4.7,'NR',98,'John, is sent in to recover a stolen Stealth Bomber. His trusty sidekick Rojar and John''s ever faithful Jessica, fight the rebel forces of Banansistan, led by the vivacious Ellianna.','The man. The myth. The Legend. Steven Seagal in...Flight of Fury','//image.tmdb.org/t/p/w300_and_h450_bestv2/xOHgXPLegeHEIS7Hukg1z7pIE7l.jpg');
INSERT INTO `movie` VALUES (24546,'tt0358294','Into the Sun',2005,15000000,0,4.3,'NR',97,'After the assassination of Tokyo''s Governor by Yakuza members, the CIA bureau chief (William Atherton) for Tokyo puts out a call to an agent (Steven Seagal) that had been raised in Japan and trained by ex-Yakuza. Using his former ties, he quickly determines that a war is brewing between old-guard Yakuza members and a young, crazed leader (Takao Osawa) with ties to the Chinese Tong.','The man. The myth. The Legend. Steven Seagal in...Into the Sun','//image.tmdb.org/t/p/w300_and_h450_bestv2/72NSrn1kcT6qhPQRrNL9wcIxKxD.jpg');
INSERT INTO `movie` VALUES (26583,'tt1296869','The Keeper',2009,10000000,0,5.5,'R',94,'Roland Sallinger is an LA cop who after nearly being killed by his greedy partner, and eventually being forced to retire for medical reasons, flees to San Antonio, Texas, after being asked to work as a bodyguard for the daughter of a wealthy businessman. The businessman had been a colleague of Sallinger years before, when they were both cops. When mobsters kidnap the businessman''s daughter, he hunts them down to rescue her and protect her','The man. The myth. The Legend. Steven Seagal in...The Keeper','//image.tmdb.org/t/p/w300_and_h450_bestv2/woe5usR12spT0S9ucvNp2njOM6v.jpg');
INSERT INTO `movie` VALUES (28465,'tt1360767','A Dangerous Man',2009,6500000,0,5.0,'NR',94,'After serving 6 years for a crime he didn''t commit, Shane Daniels is released from jail with an apology from the State of Arizona. Within hours of his freedom, he unluckily bears witness to a cop killing by Chinese mafia who have a kidnapped girl and a bag of drug money','The man. The myth. The Legend. Steven Seagal in...A Dangerous Man','//image.tmdb.org/t/p/w300_and_h450_bestv2/ggrvh1rfmAyArhRfzp0iDDkwqhi.jpg');
INSERT INTO `movie` VALUES (30806,'tt0323531','Out for a Kill',2003,14000000,0,4.3,'NR',90,'An unsuspecting university professor is an unwitting accomplice in a foiled Chinese cocaine deal. Wrongly imprisoned, he escapes to take his revenge and prove his innocence.','The man. The myth. The Legend. Steven Seagal in...Out for a Kill','//image.tmdb.org/t/p/w300_and_h450_bestv2/KiPjKXGO0aos9HoXZRrDP8BPv3.jpg');
INSERT INTO `movie` VALUES (31002,'tt0196158','Ticker',2001,7000000,0,3.7,'NR',92,'Ray Nettles, a detective of San Francisco, and his partner Fuzzy must take up to one of the most dangerous terrorist gangs of the city. When one of the terrorists, the beautiful scientist Claire Manning is arrested, Swan, the leader of the terrorists, claims he will let explode bombs throughout the city if she will not be released. Because of the possible bloodshed, Nettles calls for the help of explosive expert Frank Glass...','The man. The myth. The Legend. Steven Seagal in...Ticker','//image.tmdb.org/t/p/w300_and_h450_bestv2/eQ8akZygPmXUeipo3GsE7RnhuCr.jpg');
INSERT INTO `movie` VALUES (36272,'tt0377100','Out of Reach',2004,20000000,0,4.1,'NR',88,'Vietnam veteran Billy Ray Lancing, a former CSA agent who now works on a wildlife refuge in Northern Alaska, has been exchanging letters in a pen-pal relationship with Irina Morawska, a 13-year-old orphaned girl in Poland that he''s helping out financially. When the letters suddenly stop coming, Billy heads to Poland to figure out why -- only to discover that the orphanage that Irina was staying in, which is financed by honest -- and unsuspecting -- good-intentioned Samaritans, is a cover for a human trafficking network.','The man. The myth. The Legend. Steven Seagal in...Out of Reach','//image.tmdb.org/t/p/w300_and_h450_bestv2/vv8n1xcWlyWjwXk7Kmhit5ILu5X.jpg');
INSERT INTO `movie` VALUES (46103,'tt1528718','Born to Raise Hell',2010,10000000,0,4.0,'NR',98,'A hard core Interpol Agent is assigned to an Eastern European task force to target gun trafficking and dope running throughout the Balkans. While investigating a Russian gun dealer, his team is caught in a bloody street war between a Gypsy gang and the Russians, leaving one task force member dead. Fueled with vengeance, he leads us on an action packed thrill ride while avenging his friend''s death.','The man. The myth. The Legend. Steven Seagal in...Born to Raise Hell','//image.tmdb.org/t/p/w300_and_h450_bestv2/bYXgdHVNH1ounAwW8Kehr2f8akz.jpg');
INSERT INTO `movie` VALUES (47336,'tt0406661','Clementine',2004,2300000,0,3.5,'NR',100,'Kim, a Taekwondo champion decides to give up his fighting career for good in order to take care of his daughter Sa Rang. But when an evil gambling kingpin kidnaps Sa Rang, Kim must agree to fight in a rigged boxing match in exchange for Sa Rang''s freedom.','The man. The myth. The Legend. Steven Seagal in...Clementine','//image.tmdb.org/t/p/w300_and_h450_bestv2/pwqRRXsisB9ubqxPbY467YWFDrf.jpg');
INSERT INTO `movie` VALUES (47881,'tt0120765','My Giant',1998,0,7985929,5.1,'PG',103,'Billy Crystal plays a Hollywood agent who stumbles upon Max, a giant living in Romania, and tries to get him into the movies.','The man. The myth. The Legend. Steven Seagal in...My Giant','//image.tmdb.org/t/p/w300_and_h450_bestv2/49ylsG7JJFjNRlKTOdMQTgcI7om.jpg');
INSERT INTO `movie` VALUES (68426,'tt0184510','Get Bruce!',1999,0,0,6.2,'NR',82,'Affectionate tribute to Bruce Vilanch, who writes material for celebrities who make public appearances, from Oscar hosts and award recipients to Presidents. We meet his mom and see photos of his childhood; in Chicago, he writes for the Tribune and then heads West. Whoopi Goldberg, Billy Crystal, Robin Williams, and Bette Midler talk with him and to the camera about working with Bruce, and we also watch Bruce help others prepare for Liz Taylor''s 60th, Bill Clinton''s 50th, and an AIDS awards banquet where the hirsute, rotund Vilanch lets his emotions show.','The man. The myth. The Legend. Steven Seagal in...Get Bruce!','//image.tmdb.org/t/p/w300_and_h450_bestv2/cNlcaP5N3owquZoieCm58cbl6tt.jpg');
INSERT INTO `movie` VALUES (118483,'tt0407534','The Art of Action: Martial Arts in the Movies',2002,0,0,4.5,'NR',96,'Hosted by Samuel L. Jackson, this in-depth documentary offers viewers a behind-the-scenes look at the history of the martial arts film -- from the genre''s rebellious beginnings to high-flying modern epics. Jackson takes you through the best moments of 100 movies, including Charlie''s Angels and Oscar winner Crouching Tiger, Hidden Dragon. Interviews with martial arts film veterans Sammo Hung, John Woo and Ang Lee round out the video.','The man. The myth. The Legend. Steven Seagal in...The Art of Action: Martial Arts in the Movies','//image.tmdb.org/t/p/w300_and_h450_bestv2/2OV00Tx9AALJaGn5JLSVjs2FmB4.jpg');
INSERT INTO `movie` VALUES (118683,'tt2119474','Maximum Conviction',2012,0,0,4.8,'R',97,'When former black ops operative Tom Steele and his partner Manning are assigned to decommission an old prison, they must oversee the arrival of two mysterious female prisoners. Before long, an elite force of mercenaries assault the prison in search of the new arrivals. As the true identities of the women are revealed, Steele realizes he''s caught in the middle of something far bigger than he had imagined.','The man. The myth. The Legend. Steven Seagal in...Maximum Conviction','//image.tmdb.org/t/p/w300_and_h450_bestv2/ccwbJ27wPv66Qhgp1sFpyfUbbG3.jpg');
INSERT INTO `movie` VALUES (142463,'tt1900975','Sheep Impact',2011,0,0,3.3,'R',4,'Sheep Impact is a 2010 Australian short film, starring Steven Seagal and Martin Copping that was made as an advertisement for Carlton &amp; United Breweries. It was shot in Arizona and written and directed by Brendan Gibbons.','The man. The myth. The Legend. Steven Seagal in...Sheep Impact','//image.tmdb.org/t/p/w300_and_h450_bestv2/izDXUYWm6CXrRJ6DCcdnjBUYbte.jpg');
INSERT INTO `movie` VALUES (168454,'','Payback',2011,0,0,7.5,'NR',0,'Elijah Kane is prepping his team for court to convict Nicoli Putin of murder when they''re ambushed by Putin''s men.','The man. The myth. The Legend. Steven Seagal in...Payback','//image.tmdb.org/t/p/w300_and_h450_bestv2/cRdtHpQZYxmN2FH4GUjcML5sXqQ.jpg');
INSERT INTO `movie` VALUES (201724,'tt0170452','Prince of Central Park',2000,0,0,4.2,'NR',109,'A young boy sets out to find his mother. After setting up camp in Central Park, he encounters a group of people even needier than himself.','The man. The myth. The Legend. Steven Seagal in...Prince of Central Park','//image.tmdb.org/t/p/w300_and_h450_bestv2/rsCsTY3WljrUwUmsDUXYyWITRWU.jpg');
INSERT INTO `movie` VALUES (227359,'tt2611626','Force of Execution',2013,10000000,0,5.1,'R',98,'Seagal stars as mob kingpin Mr. Alexander, an old-school boss who rules his criminal empire with both nobility and brutality. For a simple prison hit, he sends his best enforcer and protégé Roman Hurst (Foster). When the hit goes wrong, Hurst is forced to pay the price of his failure: banishment in the city that he almost once ruled. But a war is brewing for the soul of the city between Alexander, a cold-blooded gangster known as ''The Iceman" (Rhames) and a merciless Mexican cartel. Hurst, with the help of an ex-con restaurant owner (Trejo) who has a few hidden moves of his own, will rediscover his own will to survive the coming conflict and to wreak vengeance on those who have wronged him.','The man. The myth. The Legend. Steven Seagal in...Force of Execution','//image.tmdb.org/t/p/w300_and_h450_bestv2/gMGwCftxe09Pee6zByDchuLomvG.jpg');
INSERT INTO `movie` VALUES (257298,'tt2668234','The Joe Show',2014,0,0,0.0,'NR',101,'Eight years in the making, The Joe Show is a shocking and wildly entertaining documentary about America’s most controversial Sheriff, Joe Arpaio, and his ringmaster’s approach to modern media, politics and law enforcement. Joe''s desire for fame changes democracy forever and the voters cheer as ratings soar.  The Joe Show explores how Joe uses media and his role as Sheriff to make himself the most famous law enforcement officer in the world. Racism, sex crimes, illegal immigration, first amendment rights, deaths at the hands of his employees – even Obama’s birth certificate – are all issues Joe faces and spins.  Featuring Larry King, Steven Seagal, Hugh Downs, Ted Nugent, Dan Ariely and Noam Chomsky  A movie that will engage and enlighten both Joe’s detractors and supporters, the Joe Show takes a hard yet balanced look at how democracy can survive when persuading voters becomes more important than protecting them.','The man. The myth. The Legend. Steven Seagal in...The Joe Show','//image.tmdb.org/t/p/w300_and_h450_bestv2/ysZTM4DqIMncvT5kGnoOQk0B7Ia.jpg');
INSERT INTO `movie` VALUES (272061,'tt2157842','Angel of Death',2012,0,0,4.7,'NR',0,'Steven Seagal reprises his role as Seattle undercover cop Elijah Kane in this action thriller from the True Justice series. Responding to fresh intel, Kane and his team have to intercept and neutralise the threat from terrorists attempting to offload nuclear bombs hidden in two smuggled suitcases. If that wasn''t bad enough, Kane is convinced that ''The Ghost'' is trying to lay his hands on them.','The man. The myth. The Legend. Steven Seagal in...Angel of Death','//image.tmdb.org/t/p/w300_and_h450_bestv2/cuKkhyjaVvvALl5wktmb48LYHqm.jpg');
INSERT INTO `movie` VALUES (272099,'tt2242975','True Justice Blood Alley',2012,0,0,7.3,'NR',60,'Elijah Kane Is on a new mission for the government after being promised that the CIA will provide information about who put out a hit on his previous team. Kane and the new team have to take down a high level gang boss involved in human smuggling but under investigation uncovers a larger conspiracy involving organ trafficking.','The man. The myth. The Legend. Steven Seagal in...True Justice Blood Alley','//image.tmdb.org/t/p/w300_and_h450_bestv2/rhwFuLqLBukgKhy5sgD07D8cDt4.jpg');
INSERT INTO `movie` VALUES (273817,'tt1702925','Street Wars',2011,0,0,7.5,'R',0,'When Officer Elijah Kane and his team of undercover cops discover a new lab drug flooding through the nightclubs of Seattle, they struggle to eliminate it from the streets immediately. As if dealing with a dozen dead ravers isn''t enough, the cops begin to act as security guards for an obnoxious documentarian. They quickly become privy to the filmmaker''s arrogance as he attempts to make a film regarding Seattle''s underbelly.','The man. The myth. The Legend. Steven Seagal in...Street Wars','//image.tmdb.org/t/p/w300_and_h450_bestv2/y07cMkFY7lmS8P3J5FOWafmscyM.jpg');
INSERT INTO `movie` VALUES (276615,'tt2384854','Dead Drop',2012,0,0,5.0,'NR',90,'Elijah Kane is not your average cop. As leader of an elite, undercover police unit he has dedicated his entire life to the relentless pursuit of truth and justice. And he will stop at nothing in bringing down an enemy of the law. But someone has put a price on Kane’s head and wants him and his team of crime fighters brought down. Could it be the mysterious crime boss known only as the ghost? Could it be the Russian gangsters connected to a missing suitcase of deadly nukes? Or is it a double agent informant working within the CIA? One thing’s for sure, when Elijah Kane finds out they better start saying their prayers.','The man. The myth. The Legend. Steven Seagal in...Dead Drop','//image.tmdb.org/t/p/w300_and_h450_bestv2/oPy1BzyVaRpVouN6liysOfooyYq.jpg');
INSERT INTO `movie` VALUES (285096,'','Urban Warfare',2011,0,0,6.5,'NR',0,'','The man. The myth. The Legend. Steven Seagal in...Urban Warfare','//image.tmdb.org/t/p/w300_and_h450_bestv2/tbi5Vb4QkUgoLsLmkcNXVj2kmb6.jpg');
INSERT INTO `movie` VALUES (286465,'tt1701105','Deadly Crossing',2011,0,0,5.6,'NR',86,'Elijah Kane, the head of a Special Investigation Unit, and his skilled four-member team track a network of drug dealers and killers led by Russian mastermind, Nikoli Putin, in the dangerous outskirts of Seattle. These intense undercover Seattle cops are led by Kane, a mysterious ex-military and karate influenced leader, who doesn''t have time for the paper work or the political headaches that surround a uniformed job. With his edgy tight-knit team, he tackles these murderous characters by making and playing by his own rules and getting the job done.','The man. The myth. The Legend. Steven Seagal in...Deadly Crossing','//image.tmdb.org/t/p/w300_and_h450_bestv2/s0azjN7lqJ6L5ol6P7dK10Ka2qY.jpg');
INSERT INTO `movie` VALUES (286668,'tt3480556','A Good Man',2014,7000000,0,5.0,'R',100,'After an illustrious special ops career ends in disaster, Alexander goes off the grid and attempts to lead a quiet life as a handyman at an apartment complex. But when one of his tenants and her family fall under the thumb of a Russian gangster, Alexander is dragged into an all-out war between rival Chinese and Russian gangs; forcing him to not only defend the family, but bringing him face to face with an old foe, and giving him one more chance to reconcile his past.','The man. The myth. The Legend. Steven Seagal in...A Good Man','//image.tmdb.org/t/p/w300_and_h450_bestv2/3FdqoXAavwmGLkzhcAjnSJh0fN0.jpg');
INSERT INTO `movie` VALUES (297702,'tt2252552','Gutshot Straight',2014,0,0,3.2,'R',89,'A professional poker player falls deep into underworld when he takes an unexpected wager from a mysterious high roller.','The man. The myth. The Legend. Steven Seagal in...Gutshot Straight','//image.tmdb.org/t/p/w300_and_h450_bestv2/jLmGlryvqZTk8GoiWOhb0lWL4Se.jpg');
INSERT INTO `movie` VALUES (298667,'tt2197561','True Justice -Vengeance is Mine',2012,0,0,7.0,'NR',60,'Following the attack on his precinct, Kane buries his friends and sets his sights on avenging their deaths. He assembles a new team and follows the trail across the border to Vancouver.','The man. The myth. The Legend. Steven Seagal in...True Justice -Vengeance is Mine','//image.tmdb.org/t/p/w300_and_h450_bestv2/n9CPqLNfPNeYyNBa7XZVxLwMX8G.jpg');
INSERT INTO `movie` VALUES (306325,'tt2296471','Violence of Action',2012,0,0,6.0,'NR',0,'','The man. The myth. The Legend. Steven Seagal in...Violence of Action','//image.tmdb.org/t/p/w300_and_h450_bestv2/tw7VbvVQpaO4gmAykEtSBfOX5Lw.jpg');
INSERT INTO `movie` VALUES (309366,'','Soldier of Vengeance',2012,0,0,0.0,'R',88,'Steven Seagal embarks on an all new action mission. After leaving his special undercover police force Elijah Kane returns to his shadowy past as a Special Forces operative. Kane is recruited by the government to once again work for them as a long range sniper specialist.','The man. The myth. The Legend. Steven Seagal in...Soldier of Vengeance','//image.tmdb.org/t/p/w300_and_h450_bestv2/aFBPzmrnvPYS64KCk0xwmLsnpSh.jpg');
INSERT INTO `movie` VALUES (313515,'tt1702923','Dark Vengeance',2011,0,0,7.0,'R',0,'A serial killer sows panic in the city of Seattle leaving several victims behind, all chosen under the same pattern: young women related to the world of nightclubs and a mysterious ritual of black magic.','The man. The myth. The Legend. Steven Seagal in...Dark Vengeance','//image.tmdb.org/t/p/w300_and_h450_bestv2/niYduYpVz5F8lr4G4f6HnPIFaP4.jpg');
INSERT INTO `movie` VALUES (313519,'','Lethal Justice',2011,0,0,6.0,'R',0,'','The man. The myth. The Legend. Steven Seagal in...Lethal Justice','//image.tmdb.org/t/p/w300_and_h450_bestv2/61AXYkuFc6p2xeNdBe1Z72A5DOP.jpg');
INSERT INTO `movie` VALUES (313520,'tt1702929','Brotherhood',2011,0,0,6.0,'R',0,'','The man. The myth. The Legend. Steven Seagal in...Brotherhood','//image.tmdb.org/t/p/w300_and_h450_bestv2/ncqnVdFhkotqvFuvYUV7u6UR6Yw.jpg');
INSERT INTO `movie` VALUES (332976,'tt3503840','Absolution',2015,0,0,4.7,'R',95,'When a contract killer (Steven Seagal) encounters a girl on the run from a dangerous mob boss (Vinnie Jones) with powerful political ties, running a human trafficking operation, he is torn between protecting the girl, and remaining loyal to the government agency that hired him.','The man. The myth. The Legend. Steven Seagal in...Absolution','//image.tmdb.org/t/p/w300_and_h450_bestv2/gbHQhSRr52lDv1FRXqBPTsm80dq.jpg');
INSERT INTO `movie` VALUES (364433,'tt3775086','They Call Me Jeeg Robot',2016,1900000,0,7.6,'R',112,'Enzo Ceccotti comes into contact with a radioactive substance, then accidently discovers he has superpowers. A touchy, navel-gazing introvert, he’s sure his new capabilities will do wonders for his life of crime, but that all changes when he meets Alessia, who’s convinced he’s the hero from the famous Japanese comic strip, Steel Jeeg Robot.','The man. The myth. The Legend. Steven Seagal in...They Call Me Jeeg Robot','//image.tmdb.org/t/p/w300_and_h450_bestv2/hHgsvMPhGQ5T7kJsSezQHBjGDBp.jpg');
INSERT INTO `movie` VALUES (389425,'tt4060866','Code of Honor',2016,8000000,0,4.2,'NR',106,'Colonel Robert Sikes is on a mission to rid his city of crime. As a stealthy, one-man assault team, he will take on street gangs, mobsters, and politicians with extreme prejudice until his mission is complete. His former protégé, William Porter, teams up with the local police department to bring his former commander to justice and prevent him from further vigilantism.','The man. The myth. The Legend. Steven Seagal in...Code of Honor','//image.tmdb.org/t/p/w300_and_h450_bestv2/oBAEIEMjldg7LQzV0c35nv74HNY.jpg');
INSERT INTO `movie` VALUES (394223,'tt5344794','Sniper: Special Ops',2016,0,0,5.1,'NR',84,'A Special Ops military Force, led by expert sniper Sergeant Jake Chandler, are sent to a remote Afghan village to extract an American congressman being held by the Taliban.','The man. The myth. The Legend. Steven Seagal in...Sniper: Special Ops','//image.tmdb.org/t/p/w300_and_h450_bestv2/xOQwXYnnl5E5tTuGUTvCX3OIq2B.jpg');
INSERT INTO `movie` VALUES (397003,'tt3187378','The Asian Connection',2016,0,0,4.1,'NR',91,'Two American expatriates, Jack and Sam, unwittingly steal a drug lord''s money when they rob a series of banks in Southeast Asia and become the target of the gang''s vengeance.','The man. The myth. The Legend. Steven Seagal in...The Asian Connection','//image.tmdb.org/t/p/w300_and_h450_bestv2/8z1GHkxa1Gz0hAvYtALOrowVf8b.jpg');
INSERT INTO `movie` VALUES (404654,'','Death Riders',2012,0,0,0.0,'R',90,'Steven Seagal, Hollywood’s toughest martial-arts'' superstar, is back in another explosive, hard-as-nails action thriller. Seattle, Washington, a city in the midst of crisis. While the innocent sleep, lives are being lost on the streets. The Yakuza have raged war on one of the most-feared gangs of Mexican drug lords in the world and Seattle has been caught in the crossfire. Meanwhile, a local bank has been taken siege by an unemployed man who’s armed, dangerous, and slowly slipping over the edge. The city’s only hope for justice is Sheriff Elijah Kane (Seagal) and his elite force of undercover cops, a new breed of extreme law enforcement.','The man. The myth. The Legend. Steven Seagal in...Death Riders','//image.tmdb.org/t/p/w300_and_h450_bestv2/3hk0MUhqwmWfZLUsQAJo5LzLliR.jpg');
INSERT INTO `movie` VALUES (411632,'tt2268433','End of a Gun',2016,0,0,4.4,'R',87,'A mall security guard -- and former federal agent -- crosses paths with a drug kingpin''s enforcer after he saves a woman from danger.','The man. The myth. The Legend. Steven Seagal in...End of a Gun','//image.tmdb.org/t/p/w300_and_h450_bestv2/lw7VcIFW67QcZ63FvCHA4AtxpRv.jpg');
INSERT INTO `movie` VALUES (412678,'tt4949290','Cartels',2016,7000000,0,4.9,'NR',99,'An elite team of DEA agents are assigned to protect a dangerous drug lord and take refuge in a luxury hotel while they await extraction. They soon find themselves at the center of an ambush as the drug lord''s former associates launch an explosive assault on the hotel.','The man. The myth. The Legend. Steven Seagal in...Cartels','//image.tmdb.org/t/p/w300_and_h450_bestv2/hntfcFInlqCS6gyBOVP5DfU3oX.jpg');
INSERT INTO `movie` VALUES (416149,'tt4616250','The Perfect Weapon',2016,8000000,17000000,3.8,'PG-13',88,'In a not too distant future, a totalitarian state run by ‘The Director” (Seagal) controls all aspects of life. All enemies of the state are dealt in the harshest way. Most of them are executed by the secret government’s assassins. The best operative is code-named “Condor” (Messner) – an elite agent and hit man for the government. However, in his latest assignment, “Condor” fails to kill an opposition leader, and finds himself on the run from the very same government agency that he works for. This sets in motion a chain of events with unforseen consequences for all involved.','The man. The myth. The Legend. Steven Seagal in...The Perfect Weapon','//image.tmdb.org/t/p/w300_and_h450_bestv2/sexL6gIrPP23d9Zp3jUc7qnBZQM.jpg');
INSERT INTO `movie` VALUES (423627,'tt5470222','Contract to Kill',2016,0,0,5.1,'NR',90,'Harmon is a CIA/DEA enforcer investigating Arab terrorists captured in Mexico. With his team--seductive FBI agent Zara and spy-drone pilot Sharp--he flies to Istanbul and uncovers a brutal plot: Islamic extremists plan to use Sonora drug-smuggling routes to bring deadly weapons, and leaders, into the U.S. To prevent an attack on America, Harmon must turn these two savage forces against one another before his time--and his luck--run out.','The man. The myth. The Legend. Steven Seagal in...Contract to Kill','//image.tmdb.org/t/p/w300_and_h450_bestv2/uC10Ozs0vqwwl6UldJDVQSVe7ZC.jpg');
INSERT INTO `movie` VALUES (446298,'tt2371163','True Justice: Dirty Money',1900,0,0,0.0,'R',0,'N/A','The man. The myth. The Legend. Steven Seagal in...True Justice: Dirty Money','//image.tmdb.org/t/p/w300_and_h450_bestv2/iyZXa3yLUY00tC1cx9r9Lo8UDYT.jpg');
INSERT INTO `movie` VALUES (446539,'tt2338190','One Shot, One Life',2012,0,0,0.0,'NR',90,'Inspired by True Events An abused wife and mother to a young boy escapes her violent husband and heads for California with her son. She soon learns that her husband has accused her of kidnapping and the law is in hot pursuit. Now a fugitive, she must risk her life and freedom to protect them both from this predator of a man.','The man. The myth. The Legend. Steven Seagal in...One Shot, One Life','//image.tmdb.org/t/p/w300_and_h450_bestv2/16GVpJ189RAjrKqGQM9ny0ZGxQN.jpg');
INSERT INTO `movie` VALUES (461714,'tt6015706','China Salesman',2017,0,0,10.0,'R',0,'Former heavyweight champ, Mike Tyson (Ip Man 3) and Aikido sensation Steven Seagal (Exit Wounds), have an appearance in China Salesman (aka Chinese Salesman), an action film written and directed by Tan Bing (aka Geng Weiguo).','The man. The myth. The Legend. Steven Seagal in...China Salesman','//image.tmdb.org/t/p/w300_and_h450_bestv2/ymSiLCT1ljjLUXjUNEmVbVqyxht.jpg');
